    "2013-03-15T23:16:39.806165",nt"name": "reconnaissance-of-geothermal-resources-near-u-s-naval-facilities-in-san-diego-san-diego-county-",nt"isopen":
    false,nt"url": null,nt"notes": "A reconnaissance study has found little
    evidence of potential geothermal resources useful at naval facilities in the greater
    San Diego metropolitan area. However, there is a zone of modest elevated water well
    'temperatures and slightly elevated thermal gradients that may include the eastern
    portion of the Imperial Beach Naval Air Station south of San Diego Bay. An increase
    of 0.3 - 0.4 F /100 feet over the regional thermal gradient of 1.56F /100 feet was
    conservatively calculated for this zone. The thermal gradient can be used to predict
    150F temperatures at a depth of approximately 4,000 feet.Open File Report OFR84-33_Report,
    1 Plate.  This resource is available for purchase byt the California Geological
    Survey. For more information see links provided. ",nt"license_title": null,nt"extras":
